import React, { Component } from "react";
import { connect } from "react-redux";
import {TextInput, Icon} from 'react-materialize'



class ContactForm extends Component {
    render() {
        return (
            <div>
                <form>
                    <TextInput s={12} l={2} m={2} xl={2} label='Name' />
                    <TextInput s={12} l={3} m={3} xl={3} label='Phone' />
                    <TextInput s={12} l={6} m={4} xl={4} label='Email' />
                    <a href="#" style={{bottom: "-20px"}} ><Icon>save</Icon></a>
                </form>
            </div>
        );
    }
}

const mapStateToProps = state => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(ContactForm);
